import { LIST_TOP_UP, TOP_UP_SUCCESS, TOP_UP_FAILED, RESET_TOP_UP, LIST_AGENT_SUB_FAILED, RESET_REPORT_SUCCESS } from '../../config/constant'
import { serviceTopUp } from '../../services/webServices'

//TOP UP ACTION
export function topUpAction(dispatch, params, token) {
  dispatch(doListTopUp())
  return serviceTopUp(params, token)
    .then(res => {
      dispatch(listTopUpSuccess(res.data, res.meta));
    })
    .catch(err => {
      return dispatch(listTopUpFailed(false))
    })
}
//RESET TOP UP
export function resetTopUpAction(dispatch) {
  dispatch(resetTopUp());
}

function doListTopUp() {
  return {
    type: LIST_TOP_UP,
  }
}
function listTopUpSuccess(payload, meta) {
  return {
    type: TOP_UP_SUCCESS,
    data: payload,
    meta: meta
  }
}
function listTopUpFailed() {
  return {
    type: TOP_UP_FAILED
  }
}
function resetTopUp(payload) {
  return {
    type: RESET_TOP_UP,
    data: payload
  }
}
